    type VCFDeployment(byteCode: string) =
        inherit ContractDeploymentMessage(byteCode)
        
        static let BYTECODE = ""
        
        new() = VCFDeployment(BYTECODE)
        

        
    
    [<Function("approveKYC")>]
    type ApproveKYCFunction() = 
        inherit FunctionMessage()
    
            [<Parameter("address", "_userAddress", 1)>]
            member val public UserAddress = Unchecked.defaultof<string> with get, set
        
    
    [<Function("capitalFund", typeof<CapitalFundOutputDTO>)>]
    type CapitalFundFunction() = 
        inherit FunctionMessage()
    
            [<Parameter("address", "", 1)>]
            member val public ReturnValue1 = Unchecked.defaultof<string> with get, set
            [<Parameter("uint256", "", 2)>]
            member val public ReturnValue2 = Unchecked.defaultof<BigInteger> with get, set
        
    
    [<Function("createCapital", "address")>]
    type CreateCapitalFunction() = 
        inherit FunctionMessage()
    
            [<Parameter("uint256", "_duration", 1)>]
            member val public Duration = Unchecked.defaultof<BigInteger> with get, set
            [<Parameter("uint256", "_pricePerShare", 2)>]
            member val public PricePerShare = Unchecked.defaultof<BigInteger> with get, set
            [<Parameter("uint256", "_totalSupply", 3)>]
            member val public TotalSupply = Unchecked.defaultof<BigInteger> with get, set
            [<Parameter("address", "_userAddress", 4)>]
            member val public UserAddress = Unchecked.defaultof<string> with get, set
            [<Parameter("string", "_name", 5)>]
            member val public Name = Unchecked.defaultof<string> with get, set
            [<Parameter("string", "_symbol", 6)>]
            member val public Symbol = Unchecked.defaultof<string> with get, set
        
    
    [<Function("investInCapital")>]
    type InvestInCapitalFunction() = 
        inherit FunctionMessage()
    
            [<Parameter("uint256", "_amountOfToken", 1)>]
            member val public AmountOfToken = Unchecked.defaultof<BigInteger> with get, set
            [<Parameter("uint256", "_capitalId", 2)>]
            member val public CapitalId = Unchecked.defaultof<BigInteger> with get, set
            [<Parameter("address", "_capitalOwnerAddress", 3)>]
            member val public CapitalOwnerAddress = Unchecked.defaultof<string> with get, set
        
    
    [<Function("owner", "address")>]
    type OwnerFunction() = 
        inherit FunctionMessage()
    

        
    
    [<Function("revertKYC")>]
    type RevertKYCFunction() = 
        inherit FunctionMessage()
    
            [<Parameter("address", "_userAddress", 1)>]
